import React, {Component} from "react";
import Link from 'next/link'
import { connect } from "react-redux";

class Page extends Component {

    render() {
        return (
            <div>
                <Link href='/auth'>
                  <a>Auth</a>
                </Link>
            </div>
        )
    }
}

export default connect(null, null)(Page);
